import logo from './logo.svg';
import './App.css';

const App = () => {
  const name = 'Jane';
  const isNameShowing = true;

  return (
    <div className="App">
      <h1>Hello, {isNameShowing ? name : 'someone'}!</h1>
      {name ? (
        <>
          <h1>{name}</h1>
        </>
      ) : (
        <>
          <h1>test</h1>
          <h2>there is no name</h2>
        </>
      )}
    </div>
  );
}

export default App;
